// src/components/ui/Textarea.js
import React from 'react';
import './Textarea.css';

export const Textarea = ({ value, onChange, placeholder, rows, disabled }) => {
  return (
    <textarea
      className="textarea"
      value={value}
      onChange={onChange}
      placeholder={placeholder}
      rows={rows}
      disabled={disabled}
    />
  );
};
